import React, {Component} from 'react';
import './bootstrap.css'



class Section extends Component{

  render(){
    const doctors = [
      {
        'name' : 'Nathan Sumilang',
        'description' : 'TODO'
      },
      {
        'name' : 'TODO Name',
        'description' : 'TODO description'
      }
    ];
    const forms = [
      {
        'url' : 'TODO URL',
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      },
      {
        'url' : 'TODO URL',
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      },
      {
        'url' : 'TODO URL',
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      },
      {
        'url' : 'TODO URL',
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      }
    ];
    //TODO : Add images to the slideshow
    const slideImages = [];
    return(
      //<AboutUs />
      <div>
        <Home id="home" images={slideImages} />
        <Doctor id="aboutus" doctor={doctors} />
        <FormPDF id="form" form={forms} />
        <ContactUs id="contact"/>
      </div>
    );
  }
}

const Home = props => {
  const images = props.images.map((image, index) =>{
    return(
      <div>
        <image />
      </div>
    );
  });
  return <section id="home" className="row">{images}</section>
};


const Doctor = props =>{
  const doctors = props.doctor.map((doctor, index) =>{
    return(
      <div key={index} className="col-md-6 text-center">
        <div>{doctor.name}</div>
        <div>{doctor.description}</div>
      </div>
    );
  });
  return <section id="doctors" className="row">
        <h1 className="col-md-12 text-center">Meet Our Doctors</h1>
        {doctors}</section>
};

const FormPDF = props =>{
  const forms = props.form.map((form,index) =>{
    return(
      <div key={index} className="col-md-3 text-center">
        <a href={form.URL}>
          <img href={form.sample} alt="Need Image of Form"/>
          <p>{form.title}</p>
        </a>
      </div>
    )
  });
  return <section id="forms" className="row">
      <h2 className="col-md-12 text-center">Forms</h2>
      {forms}
    </section>
};

const ContactUs = () =>{
  return(
    <section className="row">
      <div className="col-md-12 text-center">
        <h1>Contact Us</h1>
        <h5>Email: </h5>
        <h5>Phone Number: </h5>
        <h5>Address: </h5>
        <p>Address Line 1</p>
        <p>City, State Zip</p>
      </div>
    </section>
  );
}

export default Section;
